import React from "react";

const About = ()=>{
    return(
        <>
           <section id="about-sec">
               <div className="container-fluid">
                   <div className="row">
                       <div className="col-8 mx-auto">
                           <h2 className="mb-5">Advantage of Our 24 Hour Yankees Locksmith Company</h2>
                           <p className="mb-5"> The expert team of our locksmiths is always ready to provide you immediate 
                           and practical assistance whenever you are in need. We are offering 24 hours 
                           yankees locksmith service in Brooklyn; it means that our expert will be 
                           able to visit you at any time on site, whether you need help during business 
                           hours or outside of the business hours.Get out of any unexpected situation 
                           without any stress, by simply giving us a call for help. </p> 
                       </div>
                   </div>
               </div>
           </section>
        </>
    );
}

export default About;
